"use strict";(self.webpackChunkfacelec_docs=self.webpackChunkfacelec_docs||[]).push([[495],{9626:(e,a,s)=>{s.r(a),s.d(a,{data:()=>c});const c={key:"v-e5135ca8",path:"/introduccion/instalar.html",title:"Instalación",lang:"es-GT",frontmatter:{},excerpt:"",headers:[{level:2,title:"Prerrequisitos",slug:"prerrequisitos",children:[]},{level:2,title:"Obtener aplicación",slug:"obtener-aplicacion",children:[]},{level:2,title:"Instala la aplicación",slug:"instala-la-aplicacion",children:[{level:3,title:"Ejecuta la migración, parches, reconstrucción de assets de factura electrónica",slug:"ejecuta-la-migracion-parches-reconstruccion-de-assets-de-factura-electronica",children:[]}]}],filePathRelative:"introduccion/instalar.md",git:{updatedTime:1628640648e3,contributors:[{name:"monroy95",email:"m.monroyc22@gmail.com",commits:1}]}}},9818:(e,a,s)=>{s.r(a),s.d(a,{default:()=>n});const c=(0,s(6252).uE)('<h1 id="instalacion" tabindex="-1"><a class="header-anchor" href="#instalacion" aria-hidden="true">#</a> Instalación</h1><blockquote><p>Las versiones estables son:</p><ul><li><code>version-12</code> para ERPNext/Frappe version-12</li><li><code>version-13</code> para ERPNext/Frappe version-13</li></ul></blockquote><h2 id="prerrequisitos" tabindex="-1"><a class="header-anchor" href="#prerrequisitos" aria-hidden="true">#</a> Prerrequisitos</h2><blockquote><p>Frappe + ERPNext</p></blockquote><h2 id="obtener-aplicacion" tabindex="-1"><a class="header-anchor" href="#obtener-aplicacion" aria-hidden="true">#</a> Obtener aplicación</h2><p>Desde la terminal de tu servidor de producción/desarrollo, desde el directorio <code>frappe-bench</code> clona la aplicación con el comando:</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>bench get-app --branch version-13 https://github.com/sihaysistema/factura_electronica_gt.git\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>Con la bandera <code>--branch [nombre-rama]</code> puedes especificar la rama que quieras clonar.</p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>La ultima versión estable es la rama <code>version-13</code></p></div><h2 id="instala-la-aplicacion" tabindex="-1"><a class="header-anchor" href="#instala-la-aplicacion" aria-hidden="true">#</a> Instala la aplicación</h2><p>Ubicando en el directorio <code>frappe-bench</code> ejecuta:</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>bench install-app factura_electronica\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h3 id="ejecuta-la-migracion-parches-reconstruccion-de-assets-de-factura-electronica" tabindex="-1"><a class="header-anchor" href="#ejecuta-la-migracion-parches-reconstruccion-de-assets-de-factura-electronica" aria-hidden="true">#</a> Ejecuta la migración, parches, reconstrucción de assets de factura electrónica</h3><p><strong>Actualiza los parches:</strong></p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>bench update --patch\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><strong>Migra los cambios a la base de datos</strong></p><p>En este paso se insertan los custom fields, datos por default que necesita el app.</p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>bench migrate\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><strong>Reconstruye assets js/css</strong></p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>bench build --app factura_electronica\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><strong>Reinicia el bench y limpia el cache</strong></p><div class="language-bash ext-sh line-numbers-mode"><pre class="language-bash"><code>bench restart <span class="token operator">&amp;&amp;</span> bench clear-cache\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div>',22),n={render:function(e,a){return c}}}}]);